import React, { useState } from 'react';
import Adminsidebar from '../../components/Adminsidebar';
import { useLocation } from 'react-router-dom';

const Addadmin = () => {
  const [members, setMembers] = useState([]);
  const location = useLocation();
  const { data } = location.state || {};
  
  const [formData, setFormData] = useState({
    name: '',
    gender: 'male',
    email: '',
    address: '',
    password: '',
    contactNo: ''
  });

  const [con, setCon] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };
  
  const handleSubmit = async (e) => {
    e.preventDefault();
    let response;
    try {
      console.log(formData);

      response = await fetch(`http://localhost:8080/newMember/create`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });
      const d = await response.json();
      console.log(d);
      if (d.data === null) {
        setCon(d.error.message);
      } else {
        setCon('User registered successfully ' + d.data.registrationId);
      }
    } catch (networkError) {
      console.error('Network error:', networkError);
      return;
    }
  };

  return (
    <div className='text-white flex flex'>
      <div>
        <Adminsidebar data={data} />
      </div>
      
      <div>
        <form onSubmit={handleSubmit}>
          <div>
            <label>Name:</label>
            <input type="text" name="name" value={formData.name} onChange={handleChange} required />
          </div>
          <div>
            <label>Gender:</label>
            <select name="gender" value={formData.gender} onChange={handleChange} required>
              <option value="">Select Gender</option>
              <option value="male">Male</option>
              <option value="female">Female</option>
            </select>
          </div>
          <div>
            <label>Email:</label>
            <input type="email" name="email" value={formData.email} onChange={handleChange} required />
          </div>
          <div>
            <label>Address:</label>
            <input type="text" name="address" value={formData.address} onChange={handleChange} required />
          </div>
          <div>
            <label>Password:</label>
            <input type="password" name="password" value={formData.password} onChange={handleChange} required />
          </div>
          <div>
            <label>Contact No:</label>
            <input type="text" name="contactNo" value={formData.contactNo} onChange={handleChange} required />
          </div>
          <button type="submit">Add Admin</button>
        </form>
        {con && <p>{con}</p>}
      </div>
    </div>
  );
}

export default Addadmin;
